// src/App.js
import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import Sidebar from './Sidebar';
import EquipmentsPage from './EquipmentsPage';

function App() {
  const [showSidebar, setShowSidebar] = useState(false);
  const [currentPage, setCurrentPage] = useState("home");

  const toggleSidebar = () => {
    setShowSidebar(!showSidebar);
  };

  const navigateTo = (page) => {
    setCurrentPage(page);
  };

  const [equipments, setEquipments] = useState([
    { id: 1, name: "Pompe à eau", status: "Fonctionnel" },
    { id: 2, name: "Compresseur d'air", status: "En panne" }
  ]);

  return (
    <div className="app-container">
      <button className="toggle-button" onClick={toggleSidebar}>
        {showSidebar ? "Masquer le menu" : "Afficher le menu"}
      </button>
      {showSidebar && <Sidebar navigateTo={navigateTo} />}
      <div className={`content ${showSidebar ? 'with-sidebar' : 'full-width'}`}>
        {currentPage === "home" && (
          <div>
            <h1>GMAO - Gestion de Maintenance</h1>
            <p>Bienvenue dans votre application GMAO.</p>
          </div>
        )}
        {currentPage === "equipments" && <EquipmentsPage equipments={equipments} />}
      </div>
    </div>
  );
}
// Rendu du composant dans le conteneur avec id "root"
ReactDOM.render(<App />, document.getElementById('root'));

export default App;

